// SPDX-License-Identifier: MIT
pragma solidity >=0.5.16 <0.9.0;

contract BookingAppointement {
    struct Appointments {
        address patient;
        uint appointmentDate;
        uint checkOutDate;
    //    uint roomNumber;
        uint totalPrice;
        bool paid;
    }

    Appointments[] public appointment;

    uint public constant PRICE_PER_APPOINTMENT = 1 ether;

    event AppointmentsCreated(address patient, uint appointmentDate, uint checkOutDate, uint totalPrice);
    event AppointmentsPaid(uint AppointmentsId);

    function createAppointments(uint appointmentDate, uint checkOutDate) public payable {
        require(msg.value == (checkOutDate - appointmentDate) * PRICE_PER_APPOINTMENT, "Invalid payment amount.");
     //   require(roomNumber >= 1 && roomNumber <= 10, "Invalid room number.");
        require(appointmentDate >= block.timestamp, "Check-in date must be in the future.");
        require(checkOutDate > appointmentDate, "Check-out date must be after check-in date.");

        Appointments memory Appointments = Appointments(msg.sender, appointmentDate, checkOutDate, msg.value, false);
        appointment.push(Appointments);
        emit AppointmentsCreated(msg.sender, appointmentDate, checkOutDate, msg.value);
    }

    function payAppointments(uint AppointmentsId) public payable {
        Appointments storage Appointments = appointment[AppointmentsId];
        require(Appointments.patient == msg.sender, "Only the patient who created the Appointments can pay.");
        require(Appointments.paid == false, "Appointments has already been paid.");

        Appointments.paid = true;
        emit AppointmentsPaid(AppointmentsId);
    }
}
